function(e, prez) {
console.log('Button clicked - JS started');

// Replace with your Wit.ai Client Access Token
const WIT_AI_TOKEN = 'H6FMPDWLX5JH4SQL4HTJ74U2DYJOOZ3I';

// Global variables for recording state
let mediaRecorder;
let audioChunks = [];
let isRecording = false;

// Get the button DOM element via ActivePresenter API (name must match object's Name property)
const buttonElement = prez.object('recordButton').element;

async function startRecording() {
  console.log('Attempting to start recording...');
  try {
    const stream = await navigator.mediaDevices.getUserMedia({ audio: true });
    console.log('Microphone access granted:', stream);
    mediaRecorder = new MediaRecorder(stream);
    audioChunks = [];

    mediaRecorder.ondataavailable = (event) => {
      audioChunks.push(event.data);
      console.log('Audio chunk captured');
    };

    mediaRecorder.onstop = async () => {
      console.log('Recording stopped - transcribing...');
      const audioBlob = new Blob(audioChunks, { type: 'audio/wav' });
      await transcribeAudio(audioBlob);
      stream.getTracks().forEach(track => track.stop());
    };

    mediaRecorder.start();
    isRecording = true;
    buttonElement.textContent = 'Stop Recording';
    console.log('Recording started');
  } catch (err) {
    console.error('Microphone error:', err);
    alert('Microphone access failed: ' + err.message);
  }
}

async function stopRecording() {
  if (mediaRecorder && isRecording) {
    mediaRecorder.stop();
    isRecording = false;
    buttonElement.textContent = 'Start Recording';
    console.log('Recording stopped manually');
  }
}

async function transcribeAudio(audioBlob) {
  try {
    const formData = new FormData();
    formData.append('audio', audioBlob, 'recording.wav');

    const response = await fetch('https://api.wit.ai/speech?v=20230215', {
      method: 'POST',
      headers: { 'Authorization': `Bearer ${WIT_AI_TOKEN}` },
      body: formData,
    });

    if (!response.ok) throw new Error(`API error: ${response.status}`);

    const data = await response.json();
    const transcript = data.text || 'No speech detected';

    prez.variable('speechResult1', transcript);
    console.log('Transcription:', transcript);
    alert('Transcribed: ' + transcript);
  } catch (err) {
    console.error('Transcription error:', err);
    prez.variable('speechResult1', 'Transcription failed');
  }
}

// Start recording (no toggle for now - add second button if needed)
if (!isRecording) {
  await startRecording();  // Use await to catch errors early
  setTimeout(() => {
    if (isRecording) stopRecording();
  }, 10000);  // Auto-stop after 10s
}
console.log('JS execution ended');
}
